create database userDetails;
use userDetails;
show databases ;

create table signup(
userId int not null auto_increment primary key,
name varchar (500),
email varchar(500),
password varchar(500)
);

ALTER TABLE signup
MODIFY userEmail VARCHAR(500) NOT NULL UNIQUE,
MODIFY userPassword VARCHAR(500) NOT NULL UNIQUE,
MODIFY userName VARCHAR(500) NOT NULL;

select * from signup;
DROP TABLE signup;

CREATE TABLE products (
    id INT PRIMARY KEY AUTO_INCREMENT,
    productname VARCHAR(100) NOT NULL,
    imgurl LONGTEXT,
    category VARCHAR(50),
    quantity INT DEFAULT 0,
    actualprice DECIMAL(10,2) NOT NULL,
    discountprice DECIMAL(10,2) NOT NULL,
    `order` INT DEFAULT 0,
    addedtocard TINYINT(1) DEFAULT 0
);

